import '../styles/Home.css';
import React from 'react';
import pic from './img/pic1.jpg'

function Home() {
  return (
    <div className='header' style={{ backgroundImage:`url(${pic})` , 
    backgroundRepeat: 'no-repeat', width: 'auto', height: 'auto'}}>
        <p><strong>Welcome to NavTask!</strong></p>
        
    </div>
  );
}
